import React, {useEffect, useState} from "react";

const swiperContainer = {
    textAlign: 'center',
    fontsize: '18px',
    background: '#fff',
    display: 'flex',
    justifyContent: 'center',
}

function MainCardCarousel(props) {

    useEffect(() => {
        if (document.querySelector(
            'script[src="https://cdn.jsdelivr.net/npm/swiper@10/swiper-element-bundle.min.js"]'
        ))
            return;

        const script = document.createElement("Script");
        script.src = "https://cdn.jsdelivr.net/npm/swiper@10/swiper-element-bundle.min.js";
        script.async = true;
        document.body.appendChild(script);
    }, []);

    return (
        <swiper-container className="mySwiper" pagination="true" pagination-clickable="true" slides-per-view="3"
                          space-between="30" free-mode="true">
            <swiper-slide img={'/image/1.png'}>Slide 1</swiper-slide>
            <swiper-slide>Slide 2</swiper-slide>
            <swiper-slide>Slide 3</swiper-slide>
            <swiper-slide>Slide 4</swiper-slide>
            <swiper-slide>Slide 5</swiper-slide>
            <swiper-slide>Slide 6</swiper-slide>
            <swiper-slide>Slide 7</swiper-slide>
            <swiper-slide>Slide 8</swiper-slide>
            <swiper-slide>Slide 9</swiper-slide>
        </swiper-container>
    )
}

export default MainCardCarousel;
